package br.com.patiolegal.reports;

import java.io.ByteArrayInputStream;
import java.io.IOException;
import java.io.InputStream;
import java.text.SimpleDateFormat;
import java.time.LocalDateTime;
import java.util.ArrayList;
import java.util.Date;
import java.util.HashMap;
import java.util.List;
import java.util.Map;

import javax.imageio.ImageIO;

import org.apache.commons.codec.binary.Base64;
import org.springframework.util.StringUtils;

import br.com.patiolegal.dto.CompanyDTO;
import br.com.patiolegal.dto.ProtocolDTO;
import br.com.patiolegal.dto.SealDTO;
import net.sf.jasperreports.engine.JRException;
import net.sf.jasperreports.engine.JasperExportManager;
import net.sf.jasperreports.engine.JasperFillManager;
import net.sf.jasperreports.engine.data.JRBeanCollectionDataSource;

public class ReportUtils {

	private static String image = "data:image/jpeg;base64,";
	private static String qrcode = "data:image/png;base64,";

	public static void main(String[] args) {
		generateProtocolReport();
		generateSealReport();
	}

	private static void generateProtocolReport() {
		String sourceFileName = "D:/work/patiolegal/src/main/resources/reports/protocol.jasper";
		List<ProtocolDTO> list = new ArrayList<>();
		ProtocolDTO protocol = new ProtocolDTO();
		protocol.setProtocol("125.558.584.2018.03.25");
		protocol.setBoard("XXX-9999");
		protocol.setBrand("Ford");
		protocol.setCategory("Passeio");
		protocol.setChassis("9GBRJ69F0BFG1229555");
		protocol.setColor("Preto");
		protocol.setFuel("FLEX");
		protocol.setModel("Fiesta");
		protocol.setName("João Alves Ficticius Name");
		protocol.setTaxId("012.345.678-90");
		protocol.setTheyRenamed("00226485987");
		protocol.setYearFactory(2010);
		protocol.setYearModel(2011);
		
		protocol.setDateTimeIn(LocalDateTime.now().minusDays(10l));
		protocol.setAccountableIn("Marcio Ficticius");
		protocol.setDateTimeOut(LocalDateTime.now());
		protocol.setAccountableOut("Marcos Ficticius");
		protocol.setOriginCapture("PM - Polícia Militar");
		protocol.setAuthentication("843fa876-dbe9-4dc8-8532-8ad9d1bd8f41");
		list.add(protocol);
		JRBeanCollectionDataSource beanColDataSource = new JRBeanCollectionDataSource(list);

		Map<String, Object> parameters = new HashMap<>();
		CompanyDTO company = new CompanyDTO();
		company.setName("Deposito Legal de Veículos Maringá");
		company.setPublicPlace("Avenida Paranavaí 1489 (Rotatória Yamaguchi - Rodovia PR 317)");
		company.setPostalCode("87070-130");
		company.setCity("Maringá");
		company.setState("Paraná");
		company.setPhone("(44) 3030-3040");
		company.setImage(image);
		parameters.put("TITLE.LINE1", company.getLine1());
		parameters.put("TITLE.LINE2", company.getLine2());
		parameters.put("TITLE.LINE3", company.getLine3());
		String imageWithBasePrefix = StringUtils.replace(company.getImage(), "data:image/jpeg;base64,", "");
		InputStream imageIs = new ByteArrayInputStream(Base64.decodeBase64(imageWithBasePrefix.getBytes()));
		parameters.put("TITLE.IMAGE", imageIs);
		
		try {
			String printFileName = JasperFillManager.fillReportToFile(sourceFileName, parameters, beanColDataSource);
			if (printFileName != null) {
				JasperExportManager.exportReportToPdfFile(printFileName,
			               "D:\\protocolo-" + new SimpleDateFormat("ddMMyyyyHHmmss").format(new Date()) + ".pdf");
				//JasperPrintManager.printReport(printFileName, true);
			}
		} catch (JRException e) {
			e.printStackTrace();
		}
	}
	
	private static void generateSealReport() {
		String sourceFileName = "D:/work/patiolegal/src/main/resources/reports/seal.jasper";
		List<SealDTO> list = new ArrayList<>();
		SealDTO protocol = new SealDTO();
		protocol.setProtocol("125.558.584.2018.03.25");
		protocol.setAuthentication("843fa876-dbe9-4dc8-8532-8ad9d1bd8f41");
		String imageWithBasePrefix = StringUtils.replace(qrcode, "data:image/png;base64,", "");
		InputStream imageIs = new ByteArrayInputStream(Base64.decodeBase64(imageWithBasePrefix.getBytes()));
		try {
			protocol.setImage(ImageIO.read(imageIs));
		} catch (IOException e1) {
			e1.printStackTrace();
		}
		list.add(protocol);
		list.add(protocol);
		list.add(protocol);
		list.add(protocol);
		JRBeanCollectionDataSource beanColDataSource = new JRBeanCollectionDataSource(list);

		Map<String, Object> parameters = new HashMap<>();
		try {
			String printFileName = JasperFillManager.fillReportToFile(sourceFileName, parameters, beanColDataSource);
			if (printFileName != null) {
				JasperExportManager.exportReportToPdfFile(printFileName,
			               "D:\\lacre-" + new SimpleDateFormat("ddMMyyyyHHmmss").format(new Date()) + ".pdf");
				//JasperPrintManager.printReport(printFileName, true);
			}
		} catch (JRException e) {
			e.printStackTrace();
		}
	}
}
